import React from "react";
import "./App.css";
import Login from "./compon/Login";
import Posts from "./compon/Posts";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div>
      Hello Word
      <BrowserRouter>
      <Routes>
        <Route path="login">
          <input />
        </Route>
        <Route path="posts">
          <Posts />
        </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
